import { FC } from 'react';
import { Link } from 'react-router-dom';

const Header: FC = () => {
    return (
        <header>
            {/* TODO: logo */}

            <nav>
                <ul>
                    <li><Link to="/register">Register</Link></li>
                    <li><Link to="/login">Login</Link></li>
                    <li><Link to="/logout">Logout</Link></li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
